import React from 'react';
import { useLocation } from 'react-router-dom';
import { Container, Row, Col, Card, ListGroup, Button } from 'react-bootstrap';
import Charts from './components/Charts';
import SideNav from './components/SideNav';
import StatMini from './components/StatMini';
import DoughnutPair from './components/DoughnutPair';
import { FiUser } from 'react-icons/fi';
import './styles/dashboard.css';      // see §5

export default function ChartsPage() {
  const { state } = useLocation();
  if (!state?.data) return <p className="p-5 text-center">No data – upload first.</p>;

  const d = state.data;

  /* ---------- build extra demo data for side widgets --------- */
  const sparks = [ [120,115,118,122], Object.values(d.day_counts).slice(0,4), [32,30,34], [15,14,16] ];
  const miniInfo = [
    { label:'Income',     value:'120', spark:sparks[0]},
    { label:'Expenses',   value:'6%',  spark:sparks[1]},
    { label:'Investments',value:'32%', spark:sparks[2]},
    { label:'Donations',  value:'15%', spark:sparks[3]},
  ];

  const donutLeft = {
    labels: ['Expenses','Income'],
    datasets:[{data:[70,30]}],
  };
  const donutRight = {
    labels: ['Household','Tech','Leisure','Restaurants'],
    datasets:[{data:[40,25,20,15]}],
  };
  /* ----------------------------------------------------------- */

  return (
    <div className="d-flex">
      {/* side bar */}
      <SideNav />

      {/* main content */}
      <div className="flex-grow-1 main-area">
        <Container fluid>
          {/* Header + KPI row */}
          <Row className="pt-4 pb-3">
            <Col><h2 className="fw-bold">Overview</h2></Col>
          </Row>

          <Row className="g-4 kpi-row">
            {miniInfo.map((m,i) => (
              <Col key={i} xs={6} lg={3}><StatMini {...m} /></Col>
            ))}
          </Row>

          {/* central bar/line combo using your Charts component */}
          <Row className="my-4">
            <Col lg={8}>
              <Card className="shadow-sm p-3">
                <Charts data={d} />
              </Card>
            </Col>

            {/* right side profile / card slider substitute */}
            <Col lg={4}>
              <Card className="p-3 mb-4 text-center shadow-sm">
                <div className="avatar mb-2 mx-auto"><FiUser size={48} /></div>
                <h5>Jane Marie Doe</h5>
                <Button size="sm" variant="link">Edit profile</Button>
              </Card>

              <Card className="mb-4 gradient-card text-white shadow-sm">
                <Card.Body>
                  <h4>$ 12,547.62</h4>
                  <p className="small">6698 0236 7899 3301</p>
                  <Row className="small">
                    <Col>EXP 22/07</Col><Col className="text-end">CVV 015</Col>
                  </Row>
                </Card.Body>
              </Card>

              <Card className="shadow-sm">
                <Card.Body>
                  <Card.Title>Recent activities</Card.Title>
                  <ListGroup variant="flush" className="mt-3">
                    <ListGroup.Item className="d-flex justify-content-between">
                      <span>Car insurance</span><span>- $ 810.50</span>
                    </ListGroup.Item>
                    <ListGroup.Item className="d-flex justify-content-between">
                      <span>From Linda Hamilton</span><span className="text-success">+ $ 1,274.94</span>
                    </ListGroup.Item>
                    <ListGroup.Item className="d-flex justify-content-between">
                      <span>Apple Store</span><span>- $ 3,215.50</span>
                    </ListGroup.Item>
                  </ListGroup>
                </Card.Body>
              </Card>
            </Col>
          </Row>

          {/* bottom donut charts */}
          <Row className="mb-4">
            <Col>
              <Card className="shadow-sm p-4">
                <h6 className="mb-4 fw-bold">Monthly data – May</h6>
                <DoughnutPair leftData={donutLeft} rightData={donutRight} />
              </Card>
            </Col>
          </Row>
        </Container>
      </div>
    </div>
  );
}
